var makeExtend=function(e,t){if("function"===typeof e)return e;var n=e.initialize||function(){};if(t){n.prototype=new t;n.prototype.constructor=n;n.prototype.parent=t.prototype}for(prop in e)if(prop!=="initialize")n.prototype[prop]=e[prop];return n}